  shape_p4 = make_box(POINT_M1_P0, 3, 3, 1, 1)

  shape_q = make_box(shape_m1.exterior_ring.points[0], 0, 0, 4, 2)
  shape_t = make_box(shape_m1.exterior_ring.points[0], 0, 0, 2, 2)
